/* eslint-disable no-restricted-imports */
import React from "react";
import PropTypes from "prop-types";
import {makeStyles} from "@material-ui/core/styles";
import {
  ListItem,
  List,
  ListItemIcon,
  ListItemText,
  Divider,
  ListSubheader,
  Collapse,
  ListItemAvatar,
  Avatar,
  Typography,
  Grid,
  Checkbox,
  FormGroup,
  FormControlLabel,
  ListItemSecondaryAction,
  IconButton,
  Switch
} from "@material-ui/core";
import InboxIcon from "@material-ui/icons/Inbox";
import DraftsIcon from "@material-ui/icons/Drafts";
import SendIcon from "@material-ui/icons/Send";
import ExpandLess from "@material-ui/icons/ExpandLess";
import ExpandMore from "@material-ui/icons/ExpandMore";
import StarBorder from "@material-ui/icons/StarBorder";
import ImageIcon from "@material-ui/icons/Image";
import WorkIcon from "@material-ui/icons/Work";
import BeachAccessIcon from "@material-ui/icons/BeachAccess";
import FolderIcon from "@material-ui/icons/Folder";
import DeleteIcon from "@material-ui/icons/Delete";
import CommentIcon from "@material-ui/icons/Comment";
import WifiIcon from "@material-ui/icons/Wifi";
import BluetoothIcon from "@material-ui/icons/Bluetooth";
import StarIcon from "@material-ui/icons/Star";
import {FixedSizeList} from "react-window";
import {Notice, KTCodeExample} from "../../../../_metronic/_partials/controls";

// Example 1
const useStyles1 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

function ListItemLink1(props) {
  return <ListItem button component="a" {...props} />;
}

// Exanple 2
const useStyles2 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  },
  nested: {
    paddingLeft: theme.spacing(4)
  }
}));

// Example 3
const useStyles3 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Example 4
const useStyles4 = makeStyles(theme => ({
  root: {
    flexGrow: 1,
    maxWidth: 752
  },
  demo: {
    backgroundColor: theme.palette.background.paper
  },
  title: {
    margin: theme.spacing(4, 0, 2)
  }
}));

function generate(element) {
  return [0, 1, 2].map(value =>
    React.cloneElement(element, {
      key: value
    })
  );
}

// Example 5
const useStyles5 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Example 6
const useStyles6 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  },
  inline: {
    display: "inline"
  }
}));

// Example 7
const useStyles7 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Exanple 8
const useStyles8 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Example 9
const useStyles9 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Example 10
const useStyles10 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
    position: "relative",
    overflow: "auto",
    maxHeight: 300
  },
  listSection: {
    backgroundColor: "inherit"
  },
  ul: {
    backgroundColor: "inherit",
    padding: 0
  }
}));

// Example 11
const useStyles11 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Example 12
const useStyles12 = makeStyles(theme => ({
  root: {
    width: "100%",
    height: 400,
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

function Row12(props) {
  const { index, style } = props;

  return (
    <ListItem button style={style} key={index}>
      <ListItemText primary={`Item ${index + 1}`} />
    </ListItem>
  );
}

Row12.propTypes = {
  index: PropTypes.number,
  style: PropTypes.object
};

export default function ListsExamplesPage() {
  // Example 1
  const classes1 = useStyles1();

  // Example 2
  const classes2 = useStyles2();
  const [open2, setOpen2] = React.useState(true);

  function handleClick2() {
    setOpen2(!open2);
  }

  // Example 3
  const classes3 = useStyles3();

  // Example 4
  const classes4 = useStyles4();
  const [dense4, setDense4] = React.useState(false);
  const [secondary4, setSecondary4] = React.useState(false);

  // Example 5
  const classes5 = useStyles5();
  const [selectedIndex5, setSelectedIndex5] = React.useState(1);

  function handleListItemClick5(event, index) {
    setSelectedIndex5(index);
  }

  // Example 6
  const classes6 = useStyles6();

  // Example 7
  const classes7 = useStyles7();
  const [checked7, setChecked7] = React.useState([0]);

  const handleToggle7 = value => () => {
    const currentIndex = checked7.indexOf(value);
    const newChecked = [...checked7];

    if (currentIndex === -1) {
      newChecked.push(value);
    } else {
      newChecked.splice(currentIndex, 1);
    }

    setChecked7(newChecked);
  };

  // Example 8
  const classes8 = useStyles8();
  const [checked8, setChecked8] = React.useState([1]);

  const handleToggle8 = value => () => {
    const currentIndex = checked8.indexOf(value);
    const newChecked = [...checked8];

    if (currentIndex === -1) {
      newChecked.push(value);
    } else {
      newChecked.splice(currentIndex, 1);
    }

    setChecked8(newChecked);
  };

  // Example 9
  const classes9 = useStyles9();
  const [checked9, setChecked9] = React.useState(["wifi"]);

  const handleToggle9 = value => () => {
    const currentIndex = checked9.indexOf(value);
    const newChecked = [...checked9];

    if (currentIndex === -1) {
      newChecked.push(value);
    } else {
      newChecked.splice(currentIndex, 1);
    }

    setChecked9(newChecked);
  };

  // Example 10
  const classes10 = useStyles10();

  // Example 11
  const classes11 = useStyles11();

  // Example 12
  const classes12 = useStyles12();

  return (
    <>
      <Notice icon="flaticon-warning font-primary">
        <span>Lists are continuous, vertical indexes of text or images.</span>{" "}
        <span>
          For more info please check the components's official{" "}
          <a
            target="_blank"
            className="font-weight-bold"
            rel="noopener noreferrer"
            href="https://material-ui.com/components/lists/"
          >
            demos & documentation
          </a>
        </span>
      </Notice>

      <div className="row">
        <div className="col-md-6">
          <KTCodeExample
            jsCode={jsCode1}
            beforeCodeTitle="Simple List"
            codeBlockHeight="400px"
          >
            <div className={classes1.root}>
              <List component="nav" aria-label="Main mailbox folders">
                <ListItem button>
                  <ListItemIcon>
                    <InboxIcon />
                  </ListItemIcon>
                  <ListItemText primary="Inbox" />
                </ListItem>
                <ListItem button>
                  <ListItemIcon>
                    <DraftsIcon />
                  </ListItemIcon>
                  <ListItemText primary="Drafts" />
                </ListItem>
              </List>
              <Divider />
              <List component="nav" aria-label="Secondary mailbox folders">
                <ListItem button>
                  <ListItemText primary="Trash" />
                </ListItem>
                <ListItemLink1 href="#simple-list">
                  <ListItemText primary="Spam" />
                </ListItemLink1>
              </List>
            </div>
          </KTCodeExample>

          <KTCodeExample
            jsCode={jsCode3}
            beforeCodeTitle="Folder List"
            codeBlockHeight="400px"
          >
            <List className={classes3.root}>
              <ListItem>
                <ListItemAvatar>
                  <Avatar>
                    <ImageIcon />
                  </Avatar>
                </ListItemAvatar>
                <ListItemText primary="Photos" secondary="Jan 9, 2014" />
              </ListItem>
              <ListItem>
                <ListItemAvatar>
                  <Avatar>
                    <WorkIcon />
                  </Avatar>
                </ListItemAvatar>
                <ListItemText primary="Work" secondary="Jan 7, 2014" />
              </ListItem>
              <ListItem>
                <ListItemAvatar>
                  <Avatar>
                    <BeachAccessIcon />
                  </Avatar>
                </ListItemAvatar>
                <ListItemText primary="Vacation" secondary="July 20, 2014" />
              </ListItem>
            </List>
          </KTCodeExample>

          <KTCodeExample
            jsCode={jsCode5}
            beforeCodeTitle="Selected ListItem"
            codeBlockHeight="400px"
          >
            <div className={classes5.root}>
              <List component="nav" aria-label="Main mailbox folders">
                <ListItem
                  button
                  selected={selectedIndex5 === 0}
                  onClick={event => handleListItemClick5(event, 0)}
                >
                  <ListItemIcon>
                    <InboxIcon />
                  </ListItemIcon>
                  <ListItemText primary="Inbox" />
                </ListItem>
                <ListItem
                  button
                  selected={selectedIndex5 === 1}
                  onClick={event => handleListItemClick5(event, 1)}
                >
                  <ListItemIcon>
                    <DraftsIcon />
                  </ListItemIcon>
                  <ListItemText primary="Drafts" />
                </ListItem>
              </List>
              <Divider />
              <List component="nav" aria-label="Secondary mailbox folder">
                <ListItem
                  button
                  selected={selectedIndex5 === 2}
                  onClick={event => handleListItemClick5(event, 2)}
                >
                  <ListItemText primary="Trash" />
                </ListItem>
                <ListItem
                  button
                  selected={selectedIndex5 === 3}
                  onClick={event => handleListItemClick5(event, 3)}
                >
                  <ListItemText primary="Spam" />
                </ListItem>
              </List>
            </div>
          </KTCodeExample>

          <KTCodeExample
            jsCode={jsCode6}
            beforeCodeTitle="Align list items"
            codeBlockHeight="400px"
          >
            <span>
              You should change the list item alignment when displaying 3 lines
              or more, set the <code>alignItems="flex-start"</code> property.
            </span>
            <div className="separator separator-dashed my-7"></div>
            <List className={classes6.root}>
              <ListItem alignItems="flex-start">
                <ListItemAvatar>
                  <Avatar
                    alt="Remy Sharp"
                    src="https://material-ui.com/static/images/avatar/1.jpg"
                  />
                </ListItemAvatar>
                <ListItemText
                  primary="Brunch this weekend?"
                  secondary={
                    <React.Fragment>
                      <Typography
                        component="span"
                        variant="body2"
                        className={classes6.inline}
                        color="textPrimary"
                      >
                        Ali Connors
                      </Typography>
                      {" — I'll be in your neighborhood doing errands this…"}
                    </React.Fragment>
                  }
                />
              </ListItem>
              <Divider variant="inset" component="li" />
              <ListItem alignItems="flex-start">
                <ListItemAvatar>
                  <Avatar
                    alt="Remy Sharp"
                    src="https://material-ui.com/static/images/avatar/2.jpg"
                  />
                </ListItemAvatar>
                <ListItemText
                  primary="Summer BBQ"
                  secondary={
                    <React.Fragment>
                      <Typography
                        component="span"
                        variant="body2"
                        className={classes6.inline}
                        color="textPrimary"
                      >
                        to Scott, Alex, Jennifer
                      </Typography>
                      {" — Wish I could come, but I'm out of town this…"}
                    </React.Fragment>
                  }
                />
              </ListItem>
              <Divider variant="inset" component="li" />
              <ListItem alignItems="flex-start">
                <ListItemAvatar>
                  <Avatar
                    alt="Remy Sharp"
                    src="https://material-ui.com/static/images/avatar/3.jpg"
                  />
                </ListItemAvatar>
                <ListItemText
                  primary="Oui Oui"
                  secondary={
                    <React.Fragment>
                      <Typography
                        component="span"
                        variant="body2"
                        className={classes6.inline}
                        color="textPrimary"
                      >
                        Sandra Adams
                      </Typography>
                      {" — Do you have Paris recommendations? Have you ever…"}
                    </React.Fragment>
                  }
                />
              </ListItem>
            </List>
          </KTCodeExample>

          <KTCodeExample
            jsCode={jsCode7}
            beforeCodeTitle="Checkbox"
            codeBlockHeight="400px"
          >
            <span className="pb-3">
              A checkbox can either be a primary action or a secondary action.
            </span>
            <div>
              The checkbox is the primary action and the state indicator for the
              list item. The comment button is a secondary action and a separate
              target.
            </div>
            <div className="separator separator-dashed my-7"></div>
            <List className={classes7.root}>
              {[0, 1, 2, 3].map(value => {
                const labelId = `checkbox-list-label-${value}`;

                return (
                  <ListItem
                    key={value}
                    role={undefined}
                    dense
                    button
                    onClick={handleToggle7(value)}
                  >
                    <ListItemIcon>
                      <Checkbox
                        edge="start"
                        checked={checked7.indexOf(value) !== -1}
                        tabIndex={-1}
                        disableRipple
                        inputProps={{ "aria-labelledby": labelId }}
                      />
                    </ListItemIcon>
                    <ListItemText
                      id={labelId}
                      primary={`Line item ${value + 1}`}
                    />
                    <ListItemSecondaryAction>
                      <IconButton edge="end" aria-label="Comments">
                        <CommentIcon />
                      </IconButton>
                    </ListItemSecondaryAction>
                  </ListItem>
                );
              })}
            </List>
          </KTCodeExample>

          <KTCodeExample
            jsCode={jsCode9}
            beforeCodeTitle="Switch"
            codeBlockHeight="400px"
          >
            <span>
              The switch is the secondary action and a separate target.
            </span>
            <div className="separator separator-dashed my-7"></div>
            <List
              subheader={<ListSubheader>Settings</ListSubheader>}
              className={classes9.root}
            >
              <ListItem>
                <ListItemIcon>
                  <WifiIcon />
                </ListItemIcon>
                <ListItemText id="switch-list-label-wifi" primary="Wi-Fi" />
                <ListItemSecondaryAction>
                  <Switch
                    edge="end"
                    onChange={handleToggle9("wifi")}
                    checked={checked9.indexOf("wifi") !== -1}
                    inputProps={{
                      "aria-labelledby": "switch-list-label-wifi"
                    }}
                  />
                </ListItemSecondaryAction>
              </ListItem>
              <ListItem>
                <ListItemIcon>
                  <BluetoothIcon />
                </ListItemIcon>
                <ListItemText
                  id="switch-list-label-bluetooth"
                  primary="Bluetooth"
                />
                <ListItemSecondaryAction>
                  <Switch
                    edge="end"
                    onChange={handleToggle9("bluetooth")}
                    checked={checked9.indexOf("bluetooth") !== -1}
                    inputProps={{
                      "aria-labelledby": "switch-list-label-bluetooth"
                    }}
                  />
                </ListItemSecondaryAction>
              </ListItem>
            </List>
          </KTCodeExample>

          <KTCodeExample
            jsCode={jsCode11}
            beforeCodeTitle="Inset List"
            codeBlockHeight="400px"
          >
            <List
              component="nav"
              className={classes11.root}
              aria-label="Contacts"
            >
              <ListItem button>
                <ListItemIcon>
                  <StarIcon />
                </ListItemIcon>
                <ListItemText primary="Chelsea Otakan" />
              </ListItem>
              <ListItem button>
                <ListItemText inset primary="Eric Hoffman" />
              </ListItem>
            </List>
          </KTCodeExample>
        </div>
        <div className="col-md-6">
          <KTCodeExample
            jsCode={jsCode2}
            beforeCodeTitle="Nested List"
            codeBlockHeight="400px"
          >
            <List
              component="nav"
              aria-labelledby="nested-list-subheader"
              subheader={
                <ListSubheader component="div" id="nested-list-subheader">
                  Nested List Items
                </ListSubheader>
              }
              className={classes2.root}
            >
              <ListItem button>
                <ListItemIcon>
                  <SendIcon />
                </ListItemIcon>
                <ListItemText primary="Sent mail" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <DraftsIcon />
                </ListItemIcon>
                <ListItemText primary="Drafts" />
              </ListItem>
              <ListItem button onClick={handleClick2}>
                <ListItemIcon>
                  <InboxIcon />
